import React, { useState } from 'react';
import { MlsLogoShield, SunIcon, MoonIcon, MenuIcon, ChevronDownIcon } from 'lucide-react';
import styles from '../styles/Navbar.css';

function Header({ setPage, page, theme, toggleTheme }) {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [openDropdown, setOpenDropdown] = useState(null);

  const navLinks = ['Home', 'About', 'Publications', 'Submission Guidelines', 'Information Process', 'Journal Policies', 'Submit Manuscript', 'Contact Us'];
  const infoProcessLinks = ['Editorial Board', 'Publication Process', 'Peer Review Process', 'Publication Print Policy'];
  const publicationsLinks = ['Current Issue', 'Volume Archive'];
  const journalPoliciesLinks = ['Open Access Policy', 'Publication & Print Policy', 'Ethics Statement'];

  const handleNavClick = (link) => {
    setPage(link);
    setIsMenuOpen(false);
    setOpenDropdown(null);
  };

  const toggleDropdown = (dropdown) => {
    setOpenDropdown(openDropdown === dropdown ? null : dropdown);
  };

  const renderDropdown = (links, label) => {
    return (
      <div className={styles.dropdownContainer}>
        <button
          onClick={() => toggleDropdown(label)}
          className={`${styles.navLink} ${openDropdown === label ? styles.active : ''}`}
        >
          <span>{label}</span>
          <ChevronDownIcon className={`${styles.chevron} ${openDropdown === label ? styles.rotated : ''}`} />
        </button>
        {openDropdown === label && (
          <div className={styles.dropdown}>
            {links.map(link => (
              <a
                key={link}
                href="#"
                onClick={(e) => {
                  e.preventDefault();
                  handleNavClick(link);
                }}
                className={styles.dropdownLink}
              >
                {link}
              </a>
            ))}
          </div>
        )}
      </div>
    );
  };

  return (
    <header className={styles.header}>
      <div className={styles.headerContent}>
        <div className={styles.logo}>
          
          <span className={styles.logoText}>MLS Publications</span>
        </div>

        <nav className={styles.desktopNav}>
          {navLinks.map(link => {
            if (link === 'Publications') {
              return renderDropdown(publicationsLinks, link);
            }
            if (link === 'Information Process') {
              return renderDropdown(infoProcessLinks, link);
            }
            if (link === 'Journal Policies') {
              return renderDropdown(journalPoliciesLinks, link);
            }
            return (
              <a
                key={link}
                href="#"
                onClick={(e) => {
                  e.preventDefault();
                  handleNavClick(link);
                }}
                className={`${styles.navLink} ${page === link ? styles.active : ''}`}
              >
                {link}
              </a>
            );
          })}
        </nav>

        <div className={styles.rightSection}>
          <button onClick={toggleTheme} className={styles.themeToggle} aria-label="Toggle theme">
            {theme === 'dark' ? <SunIcon /> : <MoonIcon />}
          </button>
          <button
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            className={styles.menuButton}
            aria-label="Toggle menu"
          >
            <MenuIcon isOpen={isMenuOpen} />
          </button>
        </div>
      </div>

      {isMenuOpen && (
        <div className={styles.mobileNav}>
          {navLinks.map(link => {
            if (link === 'Publications') {
              return (
                <div key={link}>
                  <button
                    onClick={() => toggleDropdown('mobile-publications')}
                    className={styles.mobileNavLink}
                  >
                    {link}
                    <ChevronDownIcon className={`${styles.chevron} ${openDropdown === 'mobile-publications' ? styles.rotated : ''}`} />
                  </button>
                  {openDropdown === 'mobile-publications' && (
                    <div className={styles.mobileDropdown}>
                      {publicationsLinks.map(sublink => (
                        <a
                          key={sublink}
                          href="#"
                          onClick={(e) => {
                            e.preventDefault();
                            handleNavClick(sublink);
                          }}
                          className={styles.mobileDropdownLink}
                        >
                          {sublink}
                        </a>
                      ))}
                    </div>
                  )}
                </div>
              );
            }
            if (link === 'Information Process') {
              return (
                <div key={link}>
                  <button
                    onClick={() => toggleDropdown('mobile-info')}
                    className={styles.mobileNavLink}
                  >
                    {link}
                    <ChevronDownIcon className={`${styles.chevron} ${openDropdown === 'mobile-info' ? styles.rotated : ''}`} />
                  </button>
                  {openDropdown === 'mobile-info' && (
                    <div className={styles.mobileDropdown}>
                      {infoProcessLinks.map(sublink => (
                        <a
                          key={sublink}
                          href="#"
                          onClick={(e) => {
                            e.preventDefault();
                            handleNavClick(sublink);
                          }}
                          className={styles.mobileDropdownLink}
                        >
                          {sublink}
                        </a>
                      ))}
                    </div>
                  )}
                </div>
              );
            }
            if (link === 'Journal Policies') {
              return (
                <div key={link}>
                  <button
                    onClick={() => toggleDropdown('mobile-policies')}
                    className={styles.mobileNavLink}
                  >
                    {link}
                    <ChevronDownIcon className={`${styles.chevron} ${openDropdown === 'mobile-policies' ? styles.rotated : ''}`} />
                  </button>
                  {openDropdown === 'mobile-policies' && (
                    <div className={styles.mobileDropdown}>
                      {journalPoliciesLinks.map(sublink => (
                        <a
                          key={sublink}
                          href="#"
                          onClick={(e) => {
                            e.preventDefault();
                            handleNavClick(sublink);
                          }}
                          className={styles.mobileDropdownLink}
                        >
                          {sublink}
                        </a>
                      ))}
                    </div>
                  )}
                </div>
              );
            }
            return (
              <a
                key={link}
                href="#"
                onClick={(e) => {
                  e.preventDefault();
                  handleNavClick(link);
                }}
                className={`${styles.mobileNavLink} ${page === link ? styles.active : ''}`}
              >
                {link}
              </a>
            );
          })}
        </div>
      )}
    </header>
  );
}

export default Header;
